import * as React from "react";
import * as renderShaders from "../engine/shaders/brushColorizer";
import * as displayShaders from "../engine/shaders/display";
import { createProgram, createAndSetupTexture } from "../engine/util";
import { Texture } from "../engine/webgl/texture";
import { Renderer } from "../engine/brushRenderer";
import { Colorizer } from "../engine/brushColorizer";
import { Display } from "../engine/display";
import { brushData, brushes } from "../engine/brushes";
import { BrushSetData, BrushSet } from "../engine/brushSet";

export class RenderTest extends React.Component {


    private brushImageLoaded: boolean;
    private srcImageLoaded: boolean;
    private brushImage: HTMLImageElement;
    private srcImage: HTMLImageElement;

    test() {
        if (this.brushImageLoaded && this.srcImageLoaded) {
            const c2 = document.getElementById("c2") as HTMLCanvasElement;
            const width = this.brushImage.width;
            const height = this.brushImage.height;

            c2.width = width;
            c2.height = height;

            // let canvas = new OffscreenCanvas(width, height);
            let ctx = c2.getContext("2d");
            ctx.drawImage(this.brushImage, 0, 0);

            const imageData = ctx.getImageData(0, 0, width, height).data;

             // If there are no transparent pixels, assume that there is a white
            // background
            let isTransparentBackground = false;

            // convert shades of white to levels of transparent
            let maxValue = 0;
            let minValue = 10000;
            for (let c = 0; c < imageData.length; c += 4) {
                const r = imageData[c];
                if (r > maxValue) {
                    maxValue = r;
                }
                if (r < minValue) {
                    minValue = r;
                }
                const alpha = imageData[c + 3];
                // alpha of less than 10 is as good as fully transparent
                isTransparentBackground = isTransparentBackground || alpha <= 10;
            }
            console.log(`isTransparentBackground=${isTransparentBackground}`);
            // Only make the background transparent
            if (!isTransparentBackground) {
                // Based on min/max values in the image, normalize
                // the values and then assign to alpha.
                const alphaMultiplier = (maxValue - minValue) / 255.0;
                console.log(`alphamul=${alphaMultiplier}`);
                console.log(`min=${minValue}`);
                console.log(`max=${maxValue}`);
                for (let c = 0; c < imageData.length; c += 4) {
                    const r = imageData[c];
                    // calculate alpha
                    // darker value is higher alpha, because of
                    // the assumed white background
                    const alpha = Math.floor(255.0 - (r - minValue) * alphaMultiplier);
                    // set alpha
                    imageData[c + 3] = alpha;
                }
            }

            // Build brush set from image data
            const brushSetData: BrushSetData = {
                brushDataUri: brushData,
                height: height,
                width: width,
                brushes: brushes,
            };
            const brushSet: BrushSet = new BrushSet(brushSetData, imageData);


            const canvas = document.getElementById("c") as HTMLCanvasElement;
            const gl = canvas.getContext("webgl2");
            gl.enable(gl.BLEND);
            gl.blendFunc(gl.SRC_ALPHA, gl.ONE_MINUS_SRC_ALPHA);

            const brushesTexture = new Texture(gl, 6, brushSet.width(), brushSet.height(), brushSet.getPixels());

            createAndSetupTexture(gl, 1);
            gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, this.srcImage);

            const program = createProgram(gl, renderShaders.vert(), renderShaders.frag());
            // const renderer = new Renderer(gl, program, 10000, brushSet);
            const renderer = new Colorizer(gl, program, brushSet, null);

            const displayProgram = createProgram(gl, displayShaders.vert(), displayShaders.frag());
            const display = new Display(gl, displayProgram);


            const result = renderer.render({
                brushIndex: 0,
                color: [1, 1, 1, 0.1],
                deleted: false,
                rotation: 1,
                x: 700,
                y: 500,
            });

            display.displayTexture = 0;
            display.render();
            console.log(result);
        }
    }

    componentDidMount() {
        // https://images.pexels.com/photos/1081912/pexels-photo-1081912.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260
        // this.srcTexture = createAndSetupTexture(gl, 1);
        // gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, srcImage);

        // load image, get image pixels as Uint8Array in onload callback
        this.brushImage = new Image();
        this.brushImage.src = brushData;
        this.brushImage.onload = () => {
            this.brushImageLoaded = true;
            this.test();
        };

        this.srcImage = new Image();
        this.srcImage.src = "data:image/jpeg;base64,";
        this.srcImage.onload = () => {
            this.srcImageLoaded = true;
            this.test();
        };
    }

    render() {
        return (
            <div className="row">
                <div className="col-lg-8 offset-lg-2 col-md-12">
                    <div className="card border-primary mb-3">
                        <div className="card-header">
                            <h4 className="text-center">Sandbox</h4>

                        </div>
                        <div className="card-body">
                            <div className="row">
                                <div className="col-sm-12">
                                    <canvas id="c" width="1024" height="1024" style={{ width: "100%", border: "1px solid black" }}></canvas>
                                    <canvas id="c2" width="1024" height="1024" style={{ display: "none" }}></canvas>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
